import React from "react"
import './App.css';
import infologo from './images/logo-graphic.png';

function Home(props) {
  return (
    <div className="outer" >
      <div className="intro-left">
        <h4>Welcome!</h4>
        <h1>I'm Tanveer Brar, a second year Software Engineering student</h1>
        I am interested in gaining experience with web development. This is my website featuring my skills, personal projects and passions!
      </div>
      <div className="intro-right">
        <img src={infologo} alt="graphic logo"/>
      </div>
    </div>
  )
}

export default Home;
